import TaskCard from "./TaskCard";

function TaskList({ tasks }) {
  // usamos {tasks} para importarlo en vez de usar props y luego tener que usar props.tasks

  if (tasks.length === 0) {
    return <h1>No hay tareas aun</h1>;
  }

  return (
    <div>
      {tasks.map((task) => (
        <TaskCard task={task} />
      ))}
    </div>
  );
}

export default TaskList;
